import React, { Component } from "react";
import Profile from "../Components";

class ProfileContainer extends Component{

    constructor(props){
        super(props);

        this.state = {
            data:{}
        };
    }


    render(){

        const {data} = this.state;
        return (
            <Profile state={data} onSubmit/>
        );
    }
}

export default ProfileContainer;
